import React from 'react';
import '../App.css';
import { MainStyled } from '../styledComponent/Main-styled';
import { TextStyled } from '../styledComponent/TextStyled';
import ReactDOM from "react-dom";
import { TextFilledStyled } from '../styledComponent/TextFilled-styled';



const MainComponent: React.FC = () => {

    return (
        <MainStyled>
            <TextFilledStyled>
                <TextStyled textSize={20} color={'black'} fontWeight={'bold'}>
                    Hello my dear friend.
                </TextStyled>
                <TextStyled textSize={20} color={'black'} fontWeight={'bold'}>
                    Login to continue.
                </TextStyled>
            </TextFilledStyled>
        </MainStyled>
    )
}



export default MainComponent;
